void read_IR::thread_ap_clk_no_reset_() {
    if ( ap_rst.read() == ap_const_logic_1) {
        ap_CS_fsm = ap_ST_fsm_state1;
    } else {
        ap_CS_fsm = ap_NS_fsm.read();
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state12.read()) && 
         esl_seteq<1,1,1>(ap_const_lv1_0, icmp_ln30_fu_375_p2.read()))) {
        phi_ln30_1_reg_224 = add_ln30_1_reg_417.read();
    } else if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read())) {
        phi_ln30_1_reg_224 = ap_const_lv8_0;
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state12.read()) && 
         esl_seteq<1,1,1>(icmp_ln30_fu_375_p2.read(), ap_const_lv1_1) && 
         esl_seteq<1,1,1>(ap_const_lv1_0, icmp_ln30_1_fu_381_p2.read()))) {
        phi_ln30_reg_212 = add_ln30_reg_392.read();
    } else if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && 
                esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_1))) {
        phi_ln30_reg_212 = ap_const_lv7_0;
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state11.read()) && esl_seteq<1,1,1>(m_axi_b_RVALID.read(), ap_const_logic_1))) {
        B_buffer_0_addr_reg_422 =  (sc_lv<12>) (zext_ln30_8_fu_363_p1.read());
        B_buffer_1_addr_reg_427 =  (sc_lv<12>) (zext_ln30_8_fu_363_p1.read());
        B_buffer_2_addr_reg_432 =  (sc_lv<12>) (zext_ln30_8_fu_363_p1.read());
        B_buffer_3_addr_reg_437 =  (sc_lv<12>) (zext_ln30_8_fu_363_p1.read());
        B_buffer_4_addr_reg_442 =  (sc_lv<12>) (zext_ln30_8_fu_363_p1.read());
        B_buffer_5_addr_reg_447 =  (sc_lv<12>) (zext_ln30_8_fu_363_p1.read());
        B_buffer_6_addr_reg_452 =  (sc_lv<12>) (zext_ln30_8_fu_363_p1.read());
        B_buffer_7_addr_reg_457 =  (sc_lv<12>) (zext_ln30_8_fu_363_p1.read());
        add_ln30_1_reg_417 = add_ln30_1_fu_348_p2.read();
        b_addr_read_reg_462 = m_axi_b_RDATA.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state2.read())) {
        add_ln30_2_reg_397 = add_ln30_2_fu_270_p2.read();
        add_ln30_3_reg_406 = add_ln30_3_fu_314_p2.read();
        add_ln30_reg_392 = add_ln30_fu_240_p2.read();
        trunc_ln30_reg_402 = trunc_ln30_fu_276_p1.read();
    }
    if (esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state3.read())) {
        b_addr_reg_411 =  (sc_lv<32>) (zext_ln30_7_fu_338_p1.read());
    }
    if ((esl_seteq<1,1,1>(ap_const_logic_1, ap_CS_fsm_state1.read()) && esl_seteq<1,1,1>(ap_start.read(), ap_const_logic_1))) {
        b_offset_cast_reg_387 = b_offset_cast_fu_236_p1.read();
    }
}

